import React from 'react'


const DashBoard = () => {

    return (
        <div>
            <label>Options</label>
            <select name="Create">
                <option value='blank'></option>
                <option value='createBoard'>Create Board</option>
                <option value='createArticle'>Create Article</option>


            </select>

        </div>
    )


}
export default DashBoard;
